            const letters = ['a', 'b','c','d','e','f','g','h','i','j','k','l','m','n','o','p','q','r','s','t','u','v','w','x','y','z']
            let str = ""
            for (let i =0; i<5; i++) {
                if (Math.floor(Math.random()*2)>0) {
                    str+=(letters[Math.floor(Math.random()*26)].toUpperCase())
                } else {
                    str+=(letters[Math.floor(Math.random()*26)])
                }
            }
