            let line = ("   ".repeat(indentlayer))+"var "+namel+": u32 = "+(lis.length).toString()+";\n"
            line += ("   ".repeat(indentlayer))+"var "+name+" : array<"+ctype+", "+args.MAX+"> = array<"+ctype+", "+args.MAX+">("
                
